using System;
using System.Collections.Generic;
using TestApp.models;
using TestApp.Models;
using TestApp.ViewModels;
using Xamarin.Forms;
using Xamarin.Forms.Xaml;

namespace TestApp.Views
{
    /// <summary>
    /// This page is used to display a form so a physio can add a new exercise plan
    /// </summary>
    [XamlCompilation(XamlCompilationOptions.Compile)]
    public partial class AddPlan : ContentPage
    {
        private string id = null;
        private bool isValuesCorrect = true;
        private List<Exercise> exercises;
        private string message = "";
        private ExercisePlan plan;
        private ExerciseViewModel exercise;
        private string btnName = "";
        private string orginalPlanName = "";
        private const string image = "";
        public AddPlan(string id,List<Exercise> exercises, ExercisePlan plan,string buttonName)
        {
            InitializeComponent();
            this.id = id;
            this.exercises = exercises;
            exercise = new ExerciseViewModel();
            this.plan = plan;
            btnName = buttonName;
           
        }
        protected async override void OnAppearing()
        {
            base.OnAppearing();
            buttonName.Text = btnName;
            title.Text = btnName;
            List<string> names = new List<string>();
            foreach (Exercise exercise in exercises)
            {
                names.Add(exercise.ExerciseName);
            }
            exercise1.ItemsSource = names;
            exercise2.ItemsSource = names;
            exercise3.ItemsSource = names;

            if (plan != null)
            {
                orginalPlanName = plan.exerciseName;
                planName.Text = plan.exerciseName;
                category.SelectedItem = plan.Category;
                exercise1.SelectedItem = plan.Exercise1;
                exercise2.SelectedItem = plan.Exercise2;
                exercise3.SelectedItem = plan.Exercise3;
            }
        }
        private async void addPlan(object sender, EventArgs e)
        {
            checkEnteredValue();
            if (isValuesCorrect)
            {
                string exer1 = exercise1.SelectedItem.ToString();
                string exer2 = exercise2.SelectedItem.ToString();
                string exer3 = exercise3.SelectedItem.ToString();
                string categor = category.SelectedItem.ToString();
                if(orginalPlanName == planName.Text)
                {
                    await exercise.addNewPlanToDb(id, planName.Text, exer1, exer2, exer3, image, categor);
                }
                else
                {
                    await exercise.updatePlanToDb(id, planName.Text, exer1, exer2, exer3, image, categor, orginalPlanName);
                }
                await DisplayAlert("Alert", "Plan has been added", "OK");
                await Navigation.PopModalAsync();
            }
            else
            {
                isValuesCorrect = true;
                await DisplayAlert("Error", message, "OK");
            }
        }
        /// <summary>
        /// This method checks to see if form details are correct
        /// </summary>
        private void checkEnteredValue()
        {
            if(planName == null)
            {
                isValuesCorrect = false;
                message += "Please enter a plan name\n";
            }
            if(exercise1.SelectedIndex < 0)
            {
                isValuesCorrect = false;
                message += "Please select the first exercise\n";
            }
            if (exercise2.SelectedIndex < 0)
            {
                isValuesCorrect = false;
                message += "Please select the second exercise\n";
            }
            if (exercise3.SelectedIndex < 0)
            {
                isValuesCorrect = false;
                message += "Please select the third exercise\n";
            }
            if (category.SelectedIndex < 0)
            {
                isValuesCorrect = false;
                message += "Please select a category\n";
            }
        }
    }
}